INSERT INTO `announcement` (`id`, `type`, `title`, `announcement`, `admin_id`, `created_at`, `updated_at`, `is_del`, `source`, `status`) VALUES
(9, 6, '合作协议（股票）策略人策略交易合作协议（T+1）', '<p>策略人： &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;投资人：</p>\r\n\r\n<p>本次交易合作由策略人与投资人协商一致，就策略人提供股票投资交易策略，投资人利用自有资金和证券账户进行交易合作事宜达成如下协议：</p>\r\n\r\n<h2>第一条释义</h2>\r\n\r\n<p>本协议中，除非上下文另有解释，下列词语具有含义：</p>\r\n\r\n<ol>\r\n	<li>策略人：指通过本平台注册成为策略人的用户，作为投资人的交易合作方，负责向投资人提供股票投资交易策略的自然人。</li>\r\n	<li>投资人：指通过本平台注册成为投资人的用户，作为策略人的交易合作方，负责按股票投资交易策略并利用自有资金和证券账户进行交易的自然人。</li>\r\n	<li>股票策略人策略交易：指策略人向投资人发出买入/卖出的股票投资交易策略，投资人接受策略人的股票投资交易策略信息即时买入/卖出股票的行为。该交易策略一经发送不得变更、撤销或撤回。</li>\r\n	<li>持仓时间：T+1持仓。股票持仓时间固定截至T+1日。</li>\r\n	<li>策略触发止盈：当合作交易股票的浮动盈亏率达到特定数值时，由投资人即时卖出交易股票全部持有数量进行止盈，该触发止盈率以策略人发送交易策略时实际选择为准。</li>\r\n	<li>策略触发止损：当合作交易股票的浮动盈亏率达到特定数值时，由投资人即时卖出交易股票全部持有数量进行止损，该触发止损率以策略人发送交易策略时实际选择为准。</li>\r\n	<li>第三方支付机构：指金鼎资本委托的为本平台用户提供资金划转、结算等支付服务的第三方非金融支付机构。</li>\r\n</ol>\r\n\r\n<h2>第二条本协议签订、成立及生效</h2>\r\n\r\n<ol>\r\n	<li>本协议各方一致确认，策略人和投资人通过在金鼎资本网站或者手机App以页面点击确认的方式签订本协议。</li>\r\n	<li>策略人和投资人签订本协议时，本协议即时成立并生效，双方签订时间不一致的，以最后签订的时间为本协议成立及生效时间。</li>\r\n</ol>\r\n\r\n<h2>第三条合作事项</h2>\r\n\r\n<h3>一、合作方式</h3>\r\n\r\n<ol>\r\n	<li>策略人负责向投资人提供本次交易合作的交易策略，即买入股票交易策略/卖出股票交易策略。</li>\r\n	<li>投资人根据策略人的交易策略即时买入/卖出股票。</li>\r\n	<li>因策略人发出交易策略时点至投资人接收到交易策略时点的两时点存在时间差，策略人确认并同意投资人以接收到交易策略时点即时买入/卖出股票，并以实际卖出成交价结算。</li>\r\n	<li>因第三方机构系统故障导致不可抗力等因素导致策略人交易策略通知失败或策略人交易策略执行失败，双方约定以系统恢复就近时间重新执行策略交易并以执行的最终结果进行结算。</li>\r\n	<li>策略人应在T日9:30:00&mdash;14:50:00向投资人发出买入交易策略，但当股票属于《高 风险股票名单》的，策略人不可向投资人发出交易策略。</li>\r\n	<li>策略人须在T+1曰14:50:00前向投资人发出卖出交易策略（当股票价值的浮动盈亏达到止盈线或者止损线，视为策略人已发送卖出交易策略），否则投资人有权在T+1日的14:50:00之后的任意交易时间卖出并以实际卖出成交价结算，策略人对此不持异议。</li>\r\n	<li>投资人买入股票的时间为T日上午9:30:00-11:30:00，下午13:00:00-14:50:00，卖出股票的时间为T+1日上午9:30:00-11:30:00，下午13:00:00-14:50:00。</li>\r\n	<li>当股票T日盘中涨幅大于等于8%或盘中跌幅小于等于-8%或被列入《高风险股票名单》中。投资人有权不接受策略人的交易策略。</li>\r\n	<li>当股票T+1日盘中跌幅小于等于-9.5%时，策略人同意并确认，投资人有权在T+1日的任意交易时间卖出并以实际卖出成交价结算，并且对此不持有异议。</li>\r\n</ol>\r\n\r\n<h3>二、履约信用金</h3>\r\n\r\n<ol>\r\n	<li>策略人应于本协议订立当日向投资人支付相应比例的履约信用金（下文简称&ldquo;信用金&rdquo;）。策略人应将自己选择确认的信用金金额充值至金鼎资本平台在第三方支付机构开立的虚拟账户里，策略人足额充值后方能提交交易策略。</li>\r\n	<li>信用金具体数额以策略人实际选择为准。</li>\r\n</ol>\r\n\r\n<h3>三、亏损承担及交易结算</h3>\r\n\r\n<ol>\r\n	<li>策略交易盈亏=卖出成交金额-买入成交金额。计算结果为正值（含0）即为交易盈利，计算结果为负值时即为交易亏损。</li>\r\n	<li>延期补偿金规则：延期补偿金规则：延期补偿金收取标准为每日28.8元/万，第一个交易日开始收取，非交易日不收取。</li>\r\n	<li>策略亏损赔付：策略人承诺并授权金鼎资本平台在交易亏损时从其冻结的信用金中支付亏损款项。当亏损金额达到或者超过冻结信用金的70%，或者股票价格达到策略人设置的止损价、止盈价，投资人有权在T+1交易日的任意时间段卖出股票。当股票策略交易亏损不大于该笔信用金时，策略人承诺并授权金鼎资本平台从其冻结的信用金中支付亏损款项。当股票策略交易亏损大于该笔信用金时，由金鼎资本协助投资人向策略人进行追偿，收到包括但不限于电话、短信通知。如未能全额追偿，则相应部分由投资人承担。</li>\r\n	<li>策略股票因停牌、跌停、或其他原因导致无法卖出的，双方约定由投资人于下个交易日即时卖出全部数量的股票，若整个交易日皆因停牌、跌停或其他原因无法卖出，则继续顺延至下一交易日，直至全部卖出并按照视角卖出成交价结算。</li>\r\n	<li>策略股票停牌处理方式：</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>策略人需主动将信用金补足至期末股票市值的30%，并按日缴纳延期补偿金，收取标准为每日20元/万元，复牌后按第三条1至4规则结算。</li>\r\n	<li>策略人以期初股票市值买断，策略人将相应资金打入金鼎资本账户，由金鼎资本支付投资人，等复牌后由归还策略人，所有亏损或者盈利归策略人承担。</li>\r\n	<li>放弃，停牌后五个工作日未缴纳延期补偿金，视为放弃该笔策略，信用金0%退回。策略人不参与此笔策略交易的盈利分配，此笔交易产生的盈利有投资人单独享有，产生亏损由投资人单独承担。</li>\r\n</ol>\r\n\r\n<h2>第四条双方的权利和义务</h2>\r\n\r\n<h3>一、策略人的权利与义务</h3>\r\n\r\n<ol>\r\n	<li>当策略交易亏损时，策略人承担本次交易产生的佣金、印花税和过户费等费用，当交易策略盈利时，策略人和投资人按盈利分成比例承担交易产生的佣金、印花税和过户费等费用。</li>\r\n	<li>除本协议另有约定外，策略人对于其交易合作达成后的策略不可变更、撤销或者撤回。</li>\r\n	<li>策略人保证不会利用本平台进行非法证券交易、资金非法转移、套现及洗钱等违法犯罪活动。</li>\r\n	<li>任何使用策略人的账号、密码发送的交易策略构成策略人不可撤销的交易策略指示，由策略人自行对该策略交易的行为及结果承担责任。</li>\r\n	<li>股票如遇分红、送股、配股等，该项收益权利归策略人所有。</li>\r\n</ol>\r\n\r\n<h3>四、投资人的权利与义务</h3>\r\n\r\n<ol>\r\n	<li>为确保策略人与投资人交易合作正常进行，保障双方利益，策略人和投资人一致同意由投资人指定风险控制标准，且投资人有权调整该标准，并授权金鼎资本平台发布。</li>\r\n	<li>投资人保证不会利用本平台进行非法证券交易、资金非法转移、套现及洗钱等违法犯罪活动。</li>\r\n	<li>投资人保证其所参与的交易合作的资金来源合法，是该资金的合法所有人，完全有权使用该资金进行交易。</li>\r\n</ol>\r\n\r\n<h2>第五条其他</h2>\r\n\r\n<ol>\r\n	<li>策略人和投资人双方须通过本协议约定的方式进行交易合作，否则由此引起的法律后果及违约责任由其自行承担。</li>\r\n	<li>本协议项下的双方非个人隐私信息均为公开信息。</li>\r\n	<li>策略人和投资人同意并确认本协议项下双方的交易信息由金鼎资本平台可根据自身经营需求商业化无偿使用。</li>\r\n	<li>本协议签订地为苏州市姑苏区。</li>\r\n	<li>本协议的订立、效力、解释、履行及争议的解决均适用中华人民共和国法律。在协议履行期间，凡由本协议引起的或与本协议有关的一切争议、纠纷，当事人应首先协商解决，协商不成，任何一方则应提交姑苏区人民法院诉讼解决。</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>（股票）投顾策略交易居间服务协议</strong></h2>\r\n\r\n<p>策略人： &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;投资人：</p>\r\n\r\n<p>本协议由协议正文以及本平台已经发布的或将来可能发布的各类规则和文件的各项规定组成，如发布的规则和文件与协议正文有冲突，以公布生效日期或签署日期在后面的规则或文件为准执行。</p>\r\n\r\n<p><strong>用户通过应用界面点击确认接受本协议，即表示用户与本</strong><strong>平台</strong><strong>己达成合意并同意接受</strong><strong>&nbsp;本协议及其附属协议项下的全部约定内容，在接受本协议之前，请用户务必仔细、完整阅 读并充分理解本协议所有内容，特别是其中的加粗条款</strong><strong>。 </strong><strong>如果用户不同意本协议的任意内容，或者无法准确理解该条款的含义，请不要进行后续操作</strong><strong>。</strong></p>\r\n\r\n<h2>第六条<strong>释义</strong></h2>\r\n\r\n<p>本协议中，除非上下文另有解释，下列词语具有含义：</p>\r\n\r\n<ol>\r\n	<li>应用平台：金鼎资本</li>\r\n	<li>为策略人、投资人提供居间服务，居间服务内容包括但不限于交易合作撮合、交易策略通知、交易信息发布等。</li>\r\n	<li>策略人：指通过本平台注册成为策略人的用户，作为投资人的交易和做法，负责向投资人提供股票投资交易策略的自然人。</li>\r\n	<li>投资人：指通过本平台注册成为投资人的用户，作为策略人的交易合作方，负责按股票投资交易策略并利用自有资金和证券账户进行交易的自然人。</li>\r\n	<li>股票策略人策略交易：指策略人向投资人发出买入/卖出的股票投资交易策略，投资人接受策略人的股票投资交易策略信息即时买入/卖出股票的行为。</li>\r\n</ol>\r\n\r\n<h2>第七条<strong>本协议的生效及修订</strong></h2>\r\n\r\n<ol>\r\n	<li>本协议内容包括本协议正文及本平台所有已经发布或将来可能发布的各类规则、文件及通知，所有规则、文件及通知为本协议的有效组成部分，与本协议正文具有同等法律效力。<strong>如本平台发布的规则、文件及通知与协议正文有冲突，以公布生效日期或签署日期在后的规则、文件或通知为准执行。</strong></li>\r\n	<li><strong>一旦用户点击确认本协议或用户使用本平台该服务的，即视为用户已充分阅读、理</strong><strong>&nbsp;解并同意接受本协议所有条款及条件，本协议即成立并生效。如果用户不同意本协议的任意内容，或者无法准确理解该条款的含义，请不要进行后续操作</strong><strong>。</strong></li>\r\n	<li>用户确认并同意，在本协议履行过程中，<strong>本平台</strong><strong>有权根据网站业务需要对协议条款作出修订。</strong>一旦本协议内容发生变更，<strong>本平台</strong><strong>将通过</strong><strong>App应用</strong><strong>公示的形式通知用户，而不再向用户进行个别通知。修订后的条款于公示时生效（公示时特别明确生效时间的以公示的生</strong><strong>效时间为准</strong><strong>)。如用户不同意本网站对本协议所做的修改，則应立即</strong><strong>停止</strong><strong>使用本网站任何服务，但用户仍应对使用</strong><strong>本平台</strong><strong>服务期间的行为承担相应的</strong><strong>责任</strong><strong>。如用户继续使用本网站服务，则视为用户接受修订后的协议，并应遵照修订后的协议执行。</strong></li>\r\n</ol>\r\n\r\n<h2>第八条<strong>服务事项</strong></h2>\r\n\r\n<ol>\r\n	<li>交易合作撮合服务</li>\r\n</ol>\r\n\r\n<p>本平台作为策略人和投资人的中间方，撮合双方建立交易合作关系。</p>\r\n\r\n<ol>\r\n	<li>交易策略通知服务</li>\r\n</ol>\r\n\r\n<p>本平台为策略人和投资人在交易合作过程中提供接收/代发交易策略通知的服务，包括： 买入交易策略和卖出交易策略。本平台不对策略人所发送的交易策略做任何的担保，投资人 应自行甄别相关信息，综合考虑投资风险并自行作出投资决策。</p>\r\n\r\n<ol>\r\n	<li>交易策略信息发布服务</li>\r\n</ol>\r\n\r\n<p>3.1 平台将根据用户的授权发布相应的风险控制信息。</p>\r\n\r\n<p>3.2 同时本平台也将适时对用户进行风险提示。该风险提示仅供用户参考，本平台对此&nbsp;并不承担任何经济和法律责任。同时提醒用户，证奍投资本身属于有风险的投资，用户须充 分认识风险，并自行作出投资决策。</p>\r\n\r\n<ol>\r\n	<li>服务变更、中断成终止</li>\r\n</ol>\r\n\r\n<p>4.1 鉴于网络服务的特殊性，用户同意平台有权随时变更、中断或终止部分或全部的网&nbsp;络服务。如变更、中断或终止网络服务，平台无需对任何用户成任何第三方承担任何责任，但是平台应当在变更、中断或终止之前事先通知用户。</p>\r\n\r\n<p>4.2 <strong>用户理解，平台需要定期或不定期地对网络服务的平台或相关的设备进行检修或设备维护，如因此类情况而造成网络服务在合理时间内的中断，本平台无需对任何用户成任何第三方承担任何责任，但平台应尽可能事先进行通告。</strong></p>\r\n\r\n<p>4.3 如发生下列任何一种情形，本平台有权随时中断或终止向用户提供本协议项下的网&nbsp;络服务而无需对用户成任何第三方承担任何责任：</p>\r\n\r\n<p>4.3.1&nbsp;用户提供的个人资料不真实；</p>\r\n\r\n<p>4.3.2&nbsp;用户违反本协议中规定的使用规则；</p>\r\n\r\n<p>4.3.3&nbsp;用户在使用本协议约定的服务时未按规定向本平台支付相应的服务费。</p>\r\n\r\n<ol>\r\n	<li>费用支付</li>\r\n</ol>\r\n\r\n<p>本平台向策略人和投资人收取一定的费用，具体收费事项及资费标准由平台与用户另行&nbsp;约定或者通过平台公示的方式进行展示。</p>\r\n\r\n<h2>第九条<strong>用户声明及承诺</strong></h2>\r\n\r\n<ol>\r\n	<li>用户理解并同意本平台有权基于平台的单方判断，在其认为用户出现违反本协议约&nbsp;定之情形时，不经通知而先行暂停、中断或终止向用户提供本协议项下的全部或部分服务，并有权将注册资料移除或删除，且无需对用户或任何第三方承担责任。前述情形包括但不限于：\r\n	<ol>\r\n		<li>本平台有理由认为用户提供的个人信息或资料不具有真实性、有效性或完整性；</li>\r\n		<li>本平台发现用户有涉嫌侵犯他人合法权益行为或违法行为；</li>\r\n		<li>用户在使用收费服务时未按规定支付相应的服务费用；</li>\r\n		<li>本平台有理由认为用户己经违反平台任何规则或本协议其他约定。</li>\r\n	</ol>\r\n	</li>\r\n	<li>用户确认并同意，由于用户违反本协议，或违反通过援引并入本协议并成为本协议一部分的文件，或由于用户使用本平台服务违反任何法律法规或侵犯第三方合法权益而造成任何第三方发起任何赔偿、补偿申请或要求（包括但不限于调查取证费、律师费用、诉讼费等），用户承担对本网站及其关联方、合作伙伴以及雇员的损失予以全额赔偿的责任。</li>\r\n	<li>未经本平台事先书面同意，用户不得转让其在本协议下的任何权利和义务。</li>\r\n	<li>用户除需要遵守本协议约定外，还应遵守履行本协议有关的附件。</li>\r\n	<li>用户变更账户信息、通讯地址、电话等相关重要信息，须及时采用书面或平台同意的其他方式通知本平台；因用户未及时通知而导致其自身在本协议项下各项权益受到损失的，由用户自行承担全部责任。</li>\r\n	<li>用户知晓且同意本平台享有用户合作交易信息的使用权且无需支付相应对价。</li>\r\n	<li><strong>用户知晓且同意本平台仅向用户提供居间服务，平台既不是策略人与投资人之间交易合作关系的当事人，也不是该合作关系中策略人与投资人的保证人或连带责任人；平台根据本协议约定向策略人和投资人提供的所有服务仅供策略人和投资人决定是否进行交易合作时予以参考，无论策略人和投资人形成的交易合作关系是否存在第三方担保，在任何情况下均不应视为平台及其关联方对策略人的交易策略能力及相关交易协议的履行做出了任何明示或默示的担保，亦不应视为平台及其关联方对投资人的本金和收益做出了明示或默示的担保或保证。</strong><strong>策略人和投资人应自行判断相关信息</strong><strong>的真实性、准确性、及时性，自主决定是否进行交易合作，并承担由此而导致的一切损失或责任。</strong></li>\r\n	<li>用户在交易合作过程产生的相关税费，由用户自行向其主管税务机关申报、缴纳，本平台不负责相关事宜处理。</li>\r\n	<li>用户应保证资金来源合法，是该资金的合法所有人，如第三人对资金归属、合法性问題发生争议，由用户负责解决，与本平台无关，并保证及时赔偿交易合作方因此所遭受的一切损失。</li>\r\n</ol>\r\n\r\n<h2>第十条<strong>风险提示</strong></h2>\r\n\r\n<p>用户知晓并同意，通过本平台进行交易合作时可能面临如下风险，且除以下揭示的风险外还有其他的外部风险，均需要用户自行承担，平台不承担任何责任：</p>\r\n\r\n<ol>\r\n	<li>政策监管风险：因宏观政策、监管导向、行业政策、地区发展政策等因素引起的无法实现合作交易的风险。</li>\r\n	<li>违约风险：因交易合作方未按时履约引起损失的风险。</li>\r\n	<li>因不可抗力因素导致的风险，不可抗力因素包括但不限于以下情形：平台系统停机维护；平台所依赖的通讯设备出现故障不能进行数据传输；因台风、地震、海啸、洪水、停电、战争、恐怖袭击等不可抗力因素，造成平台系统障碍不能执行业务的；由于黑客攻击、电信部门技术调整或故障、平台升级、其他第三方的问题等原因而造成的服务中断或者延迟。</li>\r\n</ol>\r\n\r\n<h2>第十一条<strong>通知</strong></h2>\r\n\r\n<p>除本协议另有约定外，本协议履行过程中的通知应以中文书面形式，平台向用户发出的书面通知方式包括但不限于邮寄纸质通知、网站公告、电子邮件、站内信、手机短信和传真等方式。如以邮寄方式发出书面通知的，本平台按照用户在注册时所留存的通讯地址交邮后的第三个自然日即视为送达。如以网站公告、电子邮件、手机短信和传真等电子方式发出书面通知的，则在通知发送成功即视为送达。</p>\r\n\r\n<h2>第十二条<strong>协议终止及解除</strong></h2>\r\n\r\n<ol>\r\n	<li>本平台有权随时单方面修改本协议中与用户之间相关的权利义务，并根据本协议约定的方式通知用户，若用户不同意修改本协议，则应当立即停止使用本网站相关服务，则协议随即终止解除。</li>\r\n	<li>若出现任何一种以下情况，网站有权单方而解除本协议且不视为违约行为：</li>\r\n</ol>\r\n\r\n<p>2.1&nbsp;用户自行注销网站账户；</p>\r\n\r\n<p>2.2&nbsp;用户冒用他人名义、盗用他人账户使用网站服务的；</p>\r\n\r\n<p>2.3&nbsp;用户为非法目的使用网站服务的；</p>\r\n\r\n<p>2.4&nbsp;用户从事任何可能侵害网站系统、资料的行为；</p>\r\n\r\n<p>2.5&nbsp;用户从事任何损害网站名誉的行为；</p>\r\n\r\n<p>2.6&nbsp;用户违反任何法律法规、本协议约定的；</p>\r\n\r\n<p>2.7&nbsp;用户故意利用本网站系统漏洞进行非正常交易合作的；</p>\r\n\r\n<p>2.8&nbsp;监管机构认为本平台提供的服务不再符合相关监管规定的；</p>\r\n\r\n<h2>第十三条<strong>法律及争议的解决</strong></h2>\r\n\r\n<ol>\r\n	<li>本协议的订立、履行、终止、解释均适用中华人民共和国法律。</li>\r\n	<li>本协议签订地为浙江省宁波市鄞州区。在协议履行期间，凡由本协议引起的或与本协议有关的一切争议、纠纷，当事人应首先协商解决。协议不成，任何一方则应提交宁波市鄞州区中级人民法院。</li>\r\n</ol>\r\n\r\n<h2>第十四条<strong>其他</strong></h2>\r\n\r\n<ol>\r\n	<li>本协议标题仅为查阅方便而设置，不应构成对本协议的任何解释，不对标题之下的内容及范围作任何限定。</li>\r\n	<li>本协议的附件及各项补充、修订及变更，为本协议不可分割的组成部分，与本协议正文具有同等法律效力。</li>\r\n	<li>用户确认并同意，本平台有权单方面其关联方转让本协议下的权利及义务而无需经用户事先同意。</li>\r\n	<li>用户在审阅完毕本协议文本时，已阅读并自愿做出以下承诺：&ldquo;本协议已经阅读本协议所有条款，充分了解并清楚知晓相应的权利义务，并愿意承担相关风险&rdquo;。</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2018-11-19 11:56:59', '2019-08-31 00:24:24', 0, '金鼎资本', 1),
(10, 6, '（股票）投顾策略交易居间服务协议', '<h1>&nbsp;</h1>\r\n\r\n<p>策略人： &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;投资人：</p>\r\n\r\n<p>本协议由协议正文以及本平台已经发布的或将来可能发布的各类规则和文件的各项规定组成，如发布的规则和文件与协议正文有冲突，以公布生效日期或签署日期在后面的规则或文件为准执行。</p>\r\n\r\n<p><strong>用户通过应用界面点击确认接受本协议，即表示用户与本</strong><strong>平台</strong><strong>己达成合意并同意接受</strong><strong>&nbsp;本协议及其附属协议项下的全部约定内容，在接受本协议之前，请用户务必仔细、完整阅 读并充分理解本协议所有内容，特别是其中的加粗条款</strong><strong>。 </strong><strong>如果用户不同意本协议的任意内容，或者无法准确理解该条款的含义，请不要进行后续操作</strong><strong>。</strong></p>\r\n\r\n<h2>第一条<strong>释义</strong></h2>\r\n\r\n<p>本协议中，除非上下文另有解释，下列词语具有含义：</p>\r\n\r\n<ol>\r\n	<li>应用平台：金鼎资本</li>\r\n	<li>为策略人、投资人提供居间服务，居间服务内容包括但不限于交易合作撮合、交易策略通知、交易信息发布等。</li>\r\n	<li>策略人：指通过本平台注册成为策略人的用户，作为投资人的交易和做法，负责向投资人提供股票投资交易策略的自然人。</li>\r\n	<li>投资人：指通过本平台注册成为投资人的用户，作为策略人的交易合作方，负责按股票投资交易策略并利用自有资金和证券账户进行交易的自然人。</li>\r\n	<li>股票策略人策略交易：指策略人向投资人发出买入/卖出的股票投资交易策略，投资人接受策略人的股票投资交易策略信息即时买入/卖出股票的行为。</li>\r\n</ol>\r\n\r\n<h2>第二条<strong>本协议的生效及修订</strong></h2>\r\n\r\n<ol>\r\n	<li>本协议内容包括本协议正文及本平台所有已经发布或将来可能发布的各类规则、文件及通知，所有规则、文件及通知为本协议的有效组成部分，与本协议正文具有同等法律效力。<strong>如本平台发布的规则、文件及通知与协议正文有冲突，以公布生效日期或签署日期在后的规则、文件或通知为准执行。</strong></li>\r\n	<li><strong>一旦用户点击确认本协议或用户使用本平台该服务的，即视为用户已充分阅读、理</strong><strong>&nbsp;解并同意接受本协议所有条款及条件，本协议即成立并生效。如果用户不同意本协议的任意内容，或者无法准确理解该条款的含义，请不要进行后续操作</strong><strong>。</strong></li>\r\n	<li>用户确认并同意，在本协议履行过程中，<strong>本平台</strong><strong>有权根据网站业务需要对协议条款作出修订。</strong>一旦本协议内容发生变更，<strong>本平台</strong><strong>将通过</strong><strong>App应用</strong><strong>公示的形式通知用户，而不再向用户进行个别通知。修订后的条款于公示时生效（公示时特别明确生效时间的以公示的生</strong><strong>效时间为准</strong><strong>)。如用户不同意本网站对本协议所做的修改，則应立即</strong><strong>停止</strong><strong>使用本网站任何服务，但用户仍应对使用</strong><strong>本平台</strong><strong>服务期间的行为承担相应的</strong><strong>责任</strong><strong>。如用户继续使用本网站服务，则视为用户接受修订后的协议，并应遵照修订后的协议执行。</strong></li>\r\n</ol>\r\n\r\n<h2>第三条<strong>服务事项</strong></h2>\r\n\r\n<ol>\r\n	<li>交易合作撮合服务</li>\r\n</ol>\r\n\r\n<p>本平台作为策略人和投资人的中间方，撮合双方建立交易合作关系。</p>\r\n\r\n<ol>\r\n	<li>交易策略通知服务</li>\r\n</ol>\r\n\r\n<p>本平台为策略人和投资人在交易合作过程中提供接收/代发交易策略通知的服务，包括： 买入交易策略和卖出交易策略。本平台不对策略人所发送的交易策略做任何的担保，投资人 应自行甄别相关信息，综合考虑投资风险并自行作出投资决策。</p>\r\n\r\n<ol>\r\n	<li>交易策略信息发布服务</li>\r\n</ol>\r\n\r\n<p>3.1 平台将根据用户的授权发布相应的风险控制信息。</p>\r\n\r\n<p>3.2 同时本平台也将适时对用户进行风险提示。该风险提示仅供用户参考，本平台对此&nbsp;并不承担任何经济和法律责任。同时提醒用户，证奍投资本身属于有风险的投资，用户须充 分认识风险，并自行作出投资决策。</p>\r\n\r\n<ol>\r\n	<li>服务变更、中断成终止</li>\r\n</ol>\r\n\r\n<p>4.1 鉴于网络服务的特殊性，用户同意平台有权随时变更、中断或终止部分或全部的网&nbsp;络服务。如变更、中断或终止网络服务，平台无需对任何用户成任何第三方承担任何责任，但是平台应当在变更、中断或终止之前事先通知用户。</p>\r\n\r\n<p>4.2 <strong>用户理解，平台需要定期或不定期地对网络服务的平台或相关的设备进行检修或设备维护，如因此类情况而造成网络服务在合理时间内的中断，本平台无需对任何用户成任何第三方承担任何责任，但平台应尽可能事先进行通告。</strong></p>\r\n\r\n<p>4.3 如发生下列任何一种情形，本平台有权随时中断或终止向用户提供本协议项下的网&nbsp;络服务而无需对用户成任何第三方承担任何责任：</p>\r\n\r\n<p>4.3.1&nbsp;用户提供的个人资料不真实；</p>\r\n\r\n<p>4.3.2&nbsp;用户违反本协议中规定的使用规则；</p>\r\n\r\n<p>4.3.3&nbsp;用户在使用本协议约定的服务时未按规定向本平台支付相应的服务费。</p>\r\n\r\n<ol>\r\n	<li>费用支付</li>\r\n</ol>\r\n\r\n<p>本平台向策略人和投资人收取一定的费用，具体收费事项及资费标准由平台与用户另行&nbsp;约定或者通过平台公示的方式进行展示。</p>\r\n\r\n<h2>第四条<strong>用户声明及承诺</strong></h2>\r\n\r\n<ol>\r\n	<li>用户理解并同意本平台有权基于平台的单方判断，在其认为用户出现违反本协议约&nbsp;定之情形时，不经通知而先行暂停、中断或终止向用户提供本协议项下的全部或部分服务，并有权将注册资料移除或删除，且无需对用户或任何第三方承担责任。前述情形包括但不限于：\r\n	<ol>\r\n		<li>本平台有理由认为用户提供的个人信息或资料不具有真实性、有效性或完整性；</li>\r\n		<li>本平台发现用户有涉嫌侵犯他人合法权益行为或违法行为；</li>\r\n		<li>用户在使用收费服务时未按规定支付相应的服务费用；</li>\r\n		<li>本平台有理由认为用户己经违反平台任何规则或本协议其他约定。</li>\r\n	</ol>\r\n	</li>\r\n	<li>用户确认并同意，由于用户违反本协议，或违反通过援引并入本协议并成为本协议一部分的文件，或由于用户使用本平台服务违反任何法律法规或侵犯第三方合法权益而造成任何第三方发起任何赔偿、补偿申请或要求（包括但不限于调查取证费、律师费用、诉讼费等），用户承担对本网站及其关联方、合作伙伴以及雇员的损失予以全额赔偿的责任。</li>\r\n	<li>未经本平台事先书面同意，用户不得转让其在本协议下的任何权利和义务。</li>\r\n	<li>用户除需要遵守本协议约定外，还应遵守履行本协议有关的附件。</li>\r\n	<li>用户变更账户信息、通讯地址、电话等相关重要信息，须及时采用书面或平台同意的其他方式通知本平台；因用户未及时通知而导致其自身在本协议项下各项权益受到损失的，由用户自行承担全部责任。</li>\r\n	<li>用户知晓且同意本平台享有用户合作交易信息的使用权且无需支付相应对价。</li>\r\n	<li><strong>用户知晓且同意本平台仅向用户提供居间服务，平台既不是策略人与投资人之间交易合作关系的当事人，也不是该合作关系中策略人与投资人的保证人或连带责任人；平台根据本协议约定向策略人和投资人提供的所有服务仅供策略人和投资人决定是否进行交易合作时予以参考，无论策略人和投资人形成的交易合作关系是否存在第三方担保，在任何情况下均不应视为平台及其关联方对策略人的交易策略能力及相关交易协议的履行做出了任何明示或默示的担保，亦不应视为平台及其关联方对投资人的本金和收益做出了明示或默示的担保或保证。</strong><strong>策略人和投资人应自行判断相关信息</strong><strong>的真实性、准确性、及时性，自主决定是否进行交易合作，并承担由此而导致的一切损失或责任。</strong></li>\r\n	<li>用户在交易合作过程产生的相关税费，由用户自行向其主管税务机关申报、缴纳，本平台不负责相关事宜处理。</li>\r\n	<li>用户应保证资金来源合法，是该资金的合法所有人，如第三人对资金归属、合法性问題发生争议，由用户负责解决，与本平台无关，并保证及时赔偿交易合作方因此所遭受的一切损失。</li>\r\n</ol>\r\n\r\n<h2>第五条<strong>风险提示</strong></h2>\r\n\r\n<p>用户知晓并同意，通过本平台进行交易合作时可能面临如下风险，且除以下揭示的风险外还有其他的外部风险，均需要用户自行承担，平台不承担任何责任：</p>\r\n\r\n<ol>\r\n	<li>政策监管风险：因宏观政策、监管导向、行业政策、地区发展政策等因素引起的无法实现合作交易的风险。</li>\r\n	<li>违约风险：因交易合作方未按时履约引起损失的风险。</li>\r\n	<li>因不可抗力因素导致的风险，不可抗力因素包括但不限于以下情形：平台系统停机维护；平台所依赖的通讯设备出现故障不能进行数据传输；因台风、地震、海啸、洪水、停电、战争、恐怖袭击等不可抗力因素，造成平台系统障碍不能执行业务的；由于黑客攻击、电信部门技术调整或故障、平台升级、其他第三方的问题等原因而造成的服务中断或者延迟。</li>\r\n</ol>\r\n\r\n<h2>第六条<strong>通知</strong></h2>\r\n\r\n<p>除本协议另有约定外，本协议履行过程中的通知应以中文书面形式，平台向用户发出的书面通知方式包括但不限于邮寄纸质通知、网站公告、电子邮件、站内信、手机短信和传真等方式。如以邮寄方式发出书面通知的，本平台按照用户在注册时所留存的通讯地址交邮后的第三个自然日即视为送达。如以网站公告、电子邮件、手机短信和传真等电子方式发出书面通知的，则在通知发送成功即视为送达。</p>\r\n\r\n<h2>第七条<strong>协议终止及解除</strong></h2>\r\n\r\n<ol>\r\n	<li>本平台有权随时单方面修改本协议中与用户之间相关的权利义务，并根据本协议约定的方式通知用户，若用户不同意修改本协议，则应当立即停止使用本网站相关服务，则协议随即终止解除。</li>\r\n	<li>若出现任何一种以下情况，网站有权单方而解除本协议且不视为违约行为：</li>\r\n</ol>\r\n\r\n<p>2.1&nbsp;用户自行注销网站账户；</p>\r\n\r\n<p>2.2&nbsp;用户冒用他人名义、盗用他人账户使用网站服务的；</p>\r\n\r\n<p>2.3&nbsp;用户为非法目的使用网站服务的；</p>\r\n\r\n<p>2.4&nbsp;用户从事任何可能侵害网站系统、资料的行为；</p>\r\n\r\n<p>2.5&nbsp;用户从事任何损害网站名誉的行为；</p>\r\n\r\n<p>2.6&nbsp;用户违反任何法律法规、本协议约定的；</p>\r\n\r\n<p>2.7&nbsp;用户故意利用本网站系统漏洞进行非正常交易合作的；</p>\r\n\r\n<p>2.8&nbsp;监管机构认为本平台提供的服务不再符合相关监管规定的；</p>\r\n\r\n<h2>第八条<strong>法律及争议的解决</strong></h2>\r\n\r\n<ol>\r\n	<li>本协议的订立、履行、终止、解释均适用中华人民共和国法律。</li>\r\n	<li>本协议签订地为浙江省宁波市鄞州区。在协议履行期间，凡由本协议引起的或与本协议有关的一切争议、纠纷，当事人应首先协商解决。协议不成，任何一方则应提交宁波市鄞州区中级人民法院。</li>\r\n</ol>\r\n\r\n<h2>第九条<strong>其他</strong></h2>\r\n\r\n<ol>\r\n	<li>本协议标题仅为查阅方便而设置，不应构成对本协议的任何解释，不对标题之下的内容及范围作任何限定。</li>\r\n	<li>本协议的附件及各项补充、修订及变更，为本协议不可分割的组成部分，与本协议正文具有同等法律效力。</li>\r\n	<li>用户确认并同意，本平台有权单方面其关联方转让本协议下的权利及义务而无需经用户事先同意。</li>\r\n	<li>用户在审阅完毕本协议文本时，已阅读并自愿做出以下承诺：&ldquo;本协议已经阅读本协议所有条款，充分了解并清楚知晓相应的权利义务，并愿意承担相关风险&rdquo;。</li>\r\n</ol>\r\n\r\n<h1>（股票）策略人策略交易合作协议（T+1）</h1>\r\n\r\n<p>策略人： &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;投资人：</p>\r\n\r\n<p>本次交易合作由策略人与投资人协商一致，就策略人提供股票投资交易策略，投资人利用自有资金和证券账户进行交易合作事宜达成如下协议：</p>\r\n\r\n<h2>第十条释义</h2>\r\n\r\n<p>本协议中，除非上下文另有解释，下列词语具有含义：</p>\r\n\r\n<ol>\r\n	<li>策略人：指通过本平台注册成为策略人的用户，作为投资人的交易合作方，负责向投资人提供股票投资交易策略的自然人。</li>\r\n	<li>投资人：指通过本平台注册成为投资人的用户，作为策略人的交易合作方，负责按股票投资交易策略并利用自有资金和证券账户进行交易的自然人。</li>\r\n	<li>股票策略人策略交易：指策略人向投资人发出买入/卖出的股票投资交易策略，投资人接受策略人的股票投资交易策略信息即时买入/卖出股票的行为。该交易策略一经发送不得变更、撤销或撤回。</li>\r\n	<li>持仓时间：T+1持仓。股票持仓时间固定截至T+1日。</li>\r\n	<li>策略触发止盈：当合作交易股票的浮动盈亏率达到特定数值时，由投资人即时卖出交易股票全部持有数量进行止盈，该触发止盈率以策略人发送交易策略时实际选择为准。</li>\r\n	<li>策略触发止损：当合作交易股票的浮动盈亏率达到特定数值时，由投资人即时卖出交易股票全部持有数量进行止损，该触发止损率以策略人发送交易策略时实际选择为准。</li>\r\n	<li>第三方支付机构：指金鼎资本委托的为本平台用户提供资金划转、结算等支付服务的第三方非金融支付机构。</li>\r\n</ol>\r\n\r\n<h2>第十一条本协议签订、成立及生效</h2>\r\n\r\n<ol>\r\n	<li>本协议各方一致确认，策略人和投资人通过在金鼎资本网站或者手机App以页面点击确认的方式签订本协议。</li>\r\n	<li>策略人和投资人签订本协议时，本协议即时成立并生效，双方签订时间不一致的，以最后签订的时间为本协议成立及生效时间。</li>\r\n</ol>\r\n\r\n<h2>第十二条合作事项</h2>\r\n\r\n<h3>一、合作方式</h3>\r\n\r\n<ol>\r\n	<li>策略人负责向投资人提供本次交易合作的交易策略，即买入股票交易策略/卖出股票交易策略。</li>\r\n	<li>投资人根据策略人的交易策略即时买入/卖出股票。</li>\r\n	<li>因策略人发出交易策略时点至投资人接收到交易策略时点的两时点存在时间差，策略人确认并同意投资人以接收到交易策略时点即时买入/卖出股票，并以实际卖出成交价结算。</li>\r\n	<li>因第三方机构系统故障导致不可抗力等因素导致策略人交易策略通知失败或策略人交易策略执行失败，双方约定以系统恢复就近时间重新执行策略交易并以执行的最终结果进行结算。</li>\r\n	<li>策略人应在T日9:30:00&mdash;14:50:00向投资人发出买入交易策略，但当股票属于《高 风险股票名单》的，策略人不可向投资人发出交易策略。</li>\r\n	<li>策略人须在T+1曰14:50:00前向投资人发出卖出交易策略（当股票价值的浮动盈亏达到止盈线或者止损线，视为策略人已发送卖出交易策略），否则投资人有权在T+1日的14:50:00之后的任意交易时间卖出并以实际卖出成交价结算，策略人对此不持异议。</li>\r\n	<li>投资人买入股票的时间为T日上午9:30:00-11:30:00，下午13:00:00-14:50:00，卖出股票的时间为T+1日上午9:30:00-11:30:00，下午13:00:00-14:50:00。</li>\r\n	<li>当股票T日盘中涨幅大于等于8%或盘中跌幅小于等于-8%或被列入《高风险股票名单》中。投资人有权不接受策略人的交易策略。</li>\r\n	<li>当股票T+1日盘中跌幅小于等于-9.5%时，策略人同意并确认，投资人有权在T+1日的任意交易时间卖出并以实际卖出成交价结算，并且对此不持有异议。</li>\r\n</ol>\r\n\r\n<h3>二、履约信用金</h3>\r\n\r\n<ol>\r\n	<li>策略人应于本协议订立当日向投资人支付相应比例的履约信用金（下文简称&ldquo;信用金&rdquo;）。策略人应将自己选择确认的信用金金额充值至金鼎资本平台在第三方支付机构开立的虚拟账户里，策略人足额充值后方能提交交易策略。</li>\r\n	<li>信用金具体数额以策略人实际选择为准。</li>\r\n</ol>\r\n\r\n<h3>三、亏损承担及交易结算</h3>\r\n\r\n<ol>\r\n	<li>策略交易盈亏=卖出成交金额-买入成交金额。计算结果为正值（含0）即为交易盈利，计算结果为负值时即为交易亏损。</li>\r\n	<li>延期补偿金规则：延期补偿金规则：延期补偿金收取标准为每日28.8元/万，第一个交易日开始收取，非交易日不收取。</li>\r\n	<li>策略亏损赔付：策略人承诺并授权金鼎资本平台在交易亏损时从其冻结的信用金中支付亏损款项。当亏损金额达到或者超过冻结信用金的70%，或者股票价格达到策略人设置的止损价、止盈价，投资人有权在T+1交易日的任意时间段卖出股票。当股票策略交易亏损不大于该笔信用金时，策略人承诺并授权金鼎资本平台从其冻结的信用金中支付亏损款项。当股票策略交易亏损大于该笔信用金时，由金鼎资本协助投资人向策略人进行追偿，收到包括但不限于电话、短信通知。如未能全额追偿，则相应部分由投资人承担。</li>\r\n	<li>策略股票因停牌、跌停、或其他原因导致无法卖出的，双方约定由投资人于下个交易日即时卖出全部数量的股票，若整个交易日皆因停牌、跌停或其他原因无法卖出，则继续顺延至下一交易日，直至全部卖出并按照视角卖出成交价结算。</li>\r\n	<li>策略股票停牌处理方式：</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>策略人需主动将信用金补足至期末股票市值的30%，并按日缴纳延期补偿金，收取标准为每日14.4元/万元，复牌后按第三条1至4规则结算。</li>\r\n	<li>策略人以期初股票市值买断，策略人将相应资金打入金鼎资本账户，由金鼎资本支付投资人，等复牌后由归还策略人，所有亏损或者盈利归策略人承担。</li>\r\n	<li>放弃，停牌后五个工作日未缴纳延期补偿金，视为放弃该笔策略，信用金0%退回。策略人不参与此笔策略交易的盈利分配，此笔交易产生的盈利有投资人单独享有，产生亏损由投资人单独承担。</li>\r\n</ol>\r\n\r\n<h2>第十三条双方的权利和义务</h2>\r\n\r\n<h3>一、策略人的权利与义务</h3>\r\n\r\n<ol>\r\n	<li>当策略交易亏损时，策略人承担本次交易产生的佣金、印花税和过户费等费用，当交易策略盈利时，策略人和投资人按盈利分成比例承担交易产生的佣金、印花税和过户费等费用。</li>\r\n	<li>除本协议另有约定外，策略人对于其交易合作达成后的策略不可变更、撤销或者撤回。</li>\r\n	<li>策略人保证不会利用本平台进行非法证券交易、资金非法转移、套现及洗钱等违法犯罪活动。</li>\r\n	<li>任何使用策略人的账号、密码发送的交易策略构成策略人不可撤销的交易策略指示，由策略人自行对该策略交易的行为及结果承担责任。</li>\r\n	<li>股票如遇分红、送股、配股等，该项收益权利归策略人所有。</li>\r\n</ol>\r\n\r\n<h3>四、投资人的权利与义务</h3>\r\n\r\n<ol>\r\n	<li>为确保策略人与投资人交易合作正常进行，保障双方利益，策略人和投资人一致同意由投资人指定风险控制标准，且投资人有权调整该标准，并授权金鼎资本平台发布。</li>\r\n	<li>投资人保证不会利用本平台进行非法证券交易、资金非法转移、套现及洗钱等违法犯罪活动。</li>\r\n	<li>投资人保证其所参与的交易合作的资金来源合法，是该资金的合法所有人，完全有权使用该资金进行交易。</li>\r\n</ol>\r\n\r\n<h2>第十四条其他</h2>\r\n\r\n<ol>\r\n	<li>策略人和投资人双方须通过本协议约定的方式进行交易合作，否则由此引起的法律后果及违约责任由其自行承担。</li>\r\n	<li>本协议项下的双方非个人隐私信息均为公开信息。</li>\r\n	<li>策略人和投资人同意并确认本协议项下双方的交易信息由金鼎资本平台可根据自身经营需求商业化无偿使用。</li>\r\n	<li>本协议签订地为苏州市姑苏区。</li>\r\n	<li>本协议的订立、效力、解释、履行及争议的解决均适用中华人民共和国法律。在协议履行期间，凡由本协议引起的或与本协议有关的一切争议、纠纷，当事人应首先协商解决，协商不成，任何一方则应提交姑苏区人民法院诉讼解决。</li>\r\n</ol>\r\n', 1, '2018-11-19 18:53:09', '2019-08-31 00:22:08', 0, '金鼎资本', 1),
